//Import IF == Admin Else Import Bruker?
import React from 'react'

//BRUKER SIDER
import B_AktiveBestillinger from './Bruker/B_AktiveBestillingerComponent';
import B_Header from './Bruker/B_HeaderComponent';
import B_Tellelister from './Bruker/B_TellelisterComponent';
import B_Veiledninger from './Bruker/B_VeiledningerComponent';
import B_Bestill from './Bruker/B_BestillComponent'

//GENERISKE SIDER
import Footer from './FooterComponent';
import OmOss from './OmOssComponent';

import { Route, Routes, useNavigate } from 'react-router-dom';

function MainBruker () {
  const navigate = useNavigate();

  return (
    <React.Fragment>
      <B_Header/> 
      <Routes>
        <Route path='/B_Bestill' element={<B_Bestill navigate={navigate} />}/>
        <Route path='/B_AktiveBestillinger' element={<B_AktiveBestillinger navigate={navigate} />}/>
        <Route path='/B_Tellelister' element={<B_Tellelister navigate={navigate} />}/>
        <Route path='/B_Veiledninger' element={<B_Veiledninger navigate={navigate} />}/>
        <Route path='/OmOss' element={<OmOss />}/>

        <Route path='*' element={<Navigate to="/B_Bestill" />} />
      </Routes>
      <hr/>      
      <Footer/>
    </React.Fragment>
  )
}

export default MainBruker;
